import React from "react";
import { useState } from "react";

export default function HomeInputFields() {
  const [name, setName] = useState("");

  const onChangeName = (event) => {
    setName(event.target.value);
  };
  return (
    <div>
      <input type="name" onChange={onChangeName} value={name}></input>
      <button>add</button>
      <h2>{name}</h2>
    </div>
  );
}
